= \"binary\",","  metric = \"custom\",","  first_metric_only = TRUE,","  boost_from_average = TRUE,","  feature_pre_filter = FALSE,","  force_row_wise = TRUE, # para reducir warnings","  verbosity = -100,","  max_depth = -1L, # -1 significa no limitar,  por ahora lo dejo fijo","  min_gain_to_split = 0.0, # min_gain_to_split >= 0.0","  min_sum_hessian_in_leaf = 0.001, #  min_sum_hessian_in_leaf >= 0.0","  lambda_l1 = 0.0, # lambda_l1 >= 0.0","  lambda_l2 = 0.0, # lambda_l2 >= 0.0","  max_bin = 31L, # lo debo dejar fijo, no participa de la BO","","  bagging_fraction = 1.0, # 0.0 < bagging_fraction <= 1.0","  pos_bagging_fraction = 1.0, # 0.0 < pos_bagging_fraction <= 1.0","  neg_bagging_fraction = 1.0, # 0.0 < neg_bagging_fraction <= 1.0","  is_unbalance = FALSE, #","  scale_pos_weight = 1.0, # scale_pos_weight > 0.0","","  drop_rate = 0.1, # 0.0 < neg_bagging_fraction <= 1.0","  max_drop = 50, # <=0 means no limit","  skip_drop = 0.5, # 0.0 <= skip_drop <= 1.0","","  extra_trees = TRUE, # Magic Sauce","","  seed = PARAM$finalmodel$semilla",")","","","#------------------------------------------------------------------------------","#------------------------------------------------------------------------------","# Aqui empieza el programa","setwd(\"~/buckets/b1\")","","# cargo el dataset donde voy a entrenar","dataset <- fread(PARAM$input$dataset, stringsAsFactors = TRUE)","","","# Catastrophe Analysis  -------------------------------------------------------","# deben ir cosas de este estilo","#   dataset[foto_mes == 202006, active_quarter := NA]","","# Data Drifting","# por ahora, no hago nada","","","# Feature Engineering Historico  ----------------------------------------------","#   aqui deben calcularse los  lags y  lag_delta","#   Sin lags no hay paraiso ! corta la bocha","#   https://rdrr.io/cran/data.table/man/shift.html","","","#--------------------------------------","","# paso la clase a binaria que tome valores {0,1}  enteros","# set trabaja con la clase  POS = { BAJA+1, BAJA+2 }","# esta estrategia es MUY importante","dataset[, clase01 := ifelse(clase_ternaria %in% c(\"BAJA+2\", \"BAJA+1\"), 1L, 0L)]","","#--------------------------------------","","# los campos que se van a utilizar","campos_buenos <- setdiff(colnames(dataset), c(\"clase_ternaria\", \"clase01\"))","","#--------------------------------------","","","# establezco donde entreno","dataset[, train := 0L]","dataset[foto_mes %in% PARAM$input$training, train := 1L]","","#--------------------------------------","# creo las carpetas donde van los resultados","# creo la carpeta donde va el experimento","dir.create(\"./exp/\", showWarnings = FALSE)","dir.create(paste0(\"./exp/\", PARAM$experimento, \"/\"), showWarnings = FALSE)","","# Establezco el Working Directory DEL EXPERIMENTO","setwd(paste0(\"./exp/\", PARAM$experimento, \"/\"))","","","","# dejo los datos en el formato que necesita LightGBM","dtrain <- lgb.Dataset(","  data = data.matrix(dataset[train == 1L, campos_buenos, with = FALSE]),","  label = dataset[train == 1L, clase01]",")","","","# genero el modelo","param_completo <- c(","  PARAM$finalmodel$lgb_basicos,","  PARAM$finalmodel$optim",")","","modelo <- lgb.train(","  data = dtrain,","  param = param_completo,",")","","#--------------------------------------","# ahora imprimo la importancia de variables","tb_importancia <- as.data.table(lgb.importance(modelo))","archivo_importancia <- \"impo.txt\"","","fwrite(tb_importancia,","  file = archivo_importancia,","  sep = \"\\t\"",")","","#--------------------------------------","","","# aplico el modelo a los datos sin clase","dapply <- dataset[foto_mes == PARAM$input$future]","","# aplico el modelo a los datos nuevos","prediccion <- predict(","  modelo,","  data.matrix(dapply[, campos_buenos, with = FALSE])",")","","# genero la tabla de entrega","tb_entrega <- dapply[, list(numero_de_cliente, foto_mes)]","tb_entrega[, prob := prediccion]","","# grabo las probabilidad del modelo","fwrite(tb_entrega,","  file = \"prediccion.txt\",","  sep = \"\\t\"",")","","# ordeno por probabilidad descendente","setorder(tb_entrega, -prob)","","# put 1 where prob > 0.5 and 0 otherwise, and save it. the name of the file contains the count of rows where prob > 0.5","tb_entrega[, Predicted := ifelse(prob > 0.025, 1L, 0L)]","fwrite(tb_entrega[, list(numero_de_cliente, Predicted)],","  file = paste0(PARAM$experimento, \"_\", sum(tb_entrega$Predicted), \".csv\"),","  sep = \",\"",")","","","# genero archivos con los  \"envios\" mejores","# deben subirse \"inteligentemente\" a Kaggle para no malgastar submits","# si la palabra inteligentemente no le significa nada aun","# suba TODOS los archivos a Kaggle","# espera a la siguiente clase sincronica en donde el tema sera explicado","","cortes <- seq(8000, 15000, by = 500)","for (envios in cortes) {","  tb_entrega[, Predicted := 0L]","  tb_entrega[1:envios, Predicted := 1L]","","  fwrite(tb_entrega[, list(numero_de_cliente, Predicted)],","    file = paste0(PARAM$experimento, \"_\", envios, \".csv\"),","    sep = \",\"","  )","}","","cat(\"\\n\\nLa generacion de los archivos para Kaggle ha terminado\\n\")"],"stylingDirectives":[[{"start":0,"end":29,"cssClass":"pl-c"},{"start":0,"end":1,"cssClass":"pl-c"}],[{"start":0,"end":10,"cssClass":"pl-c"},{"start":0,"end":1,"cssClass":"pl-c"}],[{"start":0,"end":20,"cssClass":"pl-c"},{"start":0,"end":1,"cssClass":"pl-c"}],[],[],[{"start":0,"end":19,"cssClass":"pl-c"},{"start":0,"end":1,"cssClass":"pl-c"}],[{"start":3,"end":7,"cssClass":"pl-v"},{"start":8,"end":9,"cssClass":"pl-k"},{"start":16,"end":36,"cssClass":"pl-c"},{"start":16,"end":17,"cssClass":"pl-c"}],[{"start":5,"end":25,"cssClass":"pl-c"},{"start":5,"end":6,"cssClass":"pl-c"}],[],[{"start":8,"end":20,"cssClass":"pl-s"},{"start":8,"end":9,"cssClass":"pl-pds"},{"start":19,"end":20,"cssClass":"pl-pds"}],[{"start":8,"end":18,"cssClass":"pl-s"},{"start":8,"end":9,"cssClass":"pl-pds"},{"start":17,"end":18,"cssClass":"pl-pds"}],[],[],[{"start":0,"